import React from 'react';
import './deals.css';

const dealsData = [
  {
    id: 1,
    imageSrc: 'https://dummyimage.com/200x200/ff0000/ffffff',
    title: 'Deal 1',
  },
  {
    id: 2,
    imageSrc: 'https://dummyimage.com/200x200/00ff00/ffffff',
    title: 'Deal 2',
  },
  {
    id: 3,
    imageSrc: 'https://dummyimage.com/200x200/00ff00/ffffff',
    title: 'Deal 3',
  },
  {
    id: 4,
    imageSrc: 'https://dummyimage.com/200x200/00ff00/ffffff',
    title: 'Deal 4',
  },
  // Add more deals data here...
];

function DealsSection() {
  return (
    <div className="deals-section">
      {/* Map through your deals data and render each item */}
      {dealsData.map((deal) => (
        <div className="deals-item" key={deal.id}>
          <img className="deals-image" src={deal.imageSrc} alt={deal.title} />
          <h4>{deal.title}</h4>
        </div>
      ))}
    </div>
  );
}

export default DealsSection;
